script: |
  super -f tsv -I q841.sql | sort > q841.out

vector: true

inputs:
  - name: q841.sql
    data: |
      SELECT - tab0.col2 * - col1 - - CAST ( col1 + + tab0.col1 * 56 AS INTEGER ) AS col0 FROM tab0;
  - name: tab0

outputs:
  - name: q841.out
    data: |
      12649
      5626
      7740
